import React from 'react';

export default function Header({ onAdd }) {
  return (
    <header style={{ background: '#eee', padding: '10px' }}>
      <button onClick={() => onAdd('category')}>Add Category</button>
      <button onClick={() => onAdd('topic')}>Add Topic</button>
      <button onClick={() => onAdd('list')}>Add List</button>
      <button>Login</button>
      <button>Register</button>
    </header>
  );
}
